                    if (addBuilding == null) {
                        println("Can't add building $entity")
                    } else {
                        state = addBuilding
                    }
                }

                "inserter",
                "stack-inserter",
                "fast-inserter" -> {
                    val start = Cell((x - 0.5).roundToInt(), (y - 0.5).roundToInt())
                    val addBuilding = state.addBuilding(
